How to rename a field inside an array with database commands?<p>Disclaimer: Even though similar, not the same as <a href="https://stackoverflow.com/questions/9122966/mongodb-rename-database-field-within-array">MongoDB rename database field within array</a>.</p>
<p>I want to change the key of a field from <code>name</code> to <code>title</code> with <a href="https://docs.mongodb.com/manual/reference/command/" rel="nofollow noreferrer">database commands</a> and NOT the <a href="https://docs.mongodb.com/manual/reference/method/" rel="nofollow noreferrer">shell</a>. I found out that using <a href="https://docs.mongodb.com/manual/reference/operator/update/rename/index.html" rel="nofollow noreferrer">$rename</a> is not possible inside an array. So I turned to <a href="https://docs.mongodb.com/manual/reference/operator/update/set/index.html" rel="nofollow noreferrer">$set</a> and <a href="https://docs.mongodb.com/manual/reference/operator/update/unset/" rel="nofollow noreferrer">$unset</a> and created this:</p>
<pre><code>db.runCommand({
    update: 'apps',
    updates: [
        {
            q: {versions: {$elemMatch: {title: {$exists: false}}}},
            u: {
                $set: {'versions.$.title': '$name'}
            },
            multi: true
        },
        {
            q: {versions: {$elemMatch: {name: {$exists: true}}}},
            u: {
                $unset: {'versions.$.name': ''}
            },
            multi: true
        }
    ]
})
</code></pre>
<p>This works somewhat. It does all I want but it changes every title/name to the string &quot;$name&quot; instead of the value of the field <code>name</code>.</p>
<p>I also tried this:</p>
<pre><code>db.runCommand({
    update: 'apps',
    updates: [
        {
            q: {versions: {$elemMatch: {title: {$exists: false}}}},
            u: {
                $set: {
                    versions: {
                        $map: {
                            input: &quot;versions&quot;,
                            as: 'each',
                            in: {
                                &quot;title&quot;: &quot;$$each.name&quot;
                            }
                        }
                    }
                }
            },
            multi: true
        },
        {
            q: {versions: {$elemMatch: {name: {$exists: true}}}},
            u: {
                $unset: {'versions.$.name': ''}
            },
            multi: true
        }
    ]
})
</code></pre>
<p>But that just results in <code>[The dollar ($) prefixed field '$map' in 'versions.$map' is not valid for storage.]</code>. How would I go about renaming a field inside an array?</p>
<p>Below is a minified version of my apps collection for reference. I literally only want to change every key called <code>name</code> into <code>title</code>.</p>
<pre><code>[{
  identifier: &quot;x&quot;,
  versions: [
    {
      name: &quot;test_name&quot;
      version: &quot;x.x.x&quot;
    },
    {
      name: &quot;test_name&quot;
      version: &quot;x.x.x&quot;
    },
  ]
},
{
  identifier: &quot;y&quot;,
  versions: [
    {
      name: &quot;test_name2&quot;
      version: &quot;x.x.x&quot;
    },
    {
      name: &quot;test_name2&quot;
      version: &quot;x.x.x&quot;
    },
  ]
}, ... ]
</code></pre>

